import axios from 'axios';
import React, { useEffect, useState } from 'react'
import Card from 'react-bootstrap/Card';
const Appointment = () => {
    const [data, setData] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:5050/auth/appointmentForm');
                setData(response.data);
            } catch (error) {
                console.log(error);
            }
        };

        fetchData();
    }, []);
    console.log(data);

    return (
        <div className='d-flex justify-content-center align-items-center mx-auto  mt-5'>
            <div className='d-flex border bg-black bg-opacity-10 p-4 gap-2 ' style={{ width: '80vw', height: '50vh' }}>
                <Card className="bg-dark text-white">
                    <div className=''>{data[0].address}</div>
                </Card>
                <div>{data[0].appointmentFor}</div>
                <div>{data[0].city}</div>
                <div>{data[0].state}</div>
                <div>{data[0].firstName}</div>
                <div>{data[0].LastName}</div>
                <div>{data[0].mobileNo}</div>
                <div>{data[0].selectedDate}</div>
                <div>{data[0].selectedTime}</div>

            </div>
        </div>
    )
}

export default Appointment
